import React, { useState } from 'react';

function AddDataModal({ isOpen, onClose, onAddData }) {
  const [data, setData] = useState({
    buildingType: '',
    buildingCost: '',
    constructionTime: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setData({
      ...data,
      [name]: value,
    });
  };

  const handleSubmit = () => {
    // Validate data here if needed

    // Call the onAddData function to add the data to the table
    onAddData(data);

    // Clear the form and close the modal
    setData({
      buildingType: '',
      buildingCost: '',
      constructionTime: '',
    });
    onClose();
  };

  return (
    <div className={`modal ${isOpen ? 'open' : ''}`}>
      <div className="modal-content">
        <h2>Add Data</h2>
        <label>Building Type</label>
        <input
          type="text"
          name="buildingType"
          value={data.buildingType}
          onChange={handleInputChange}
        />
        <label>Building Cost</label>
        <input
          type="text"
          name="buildingCost"
          value={data.buildingCost}
          onChange={handleInputChange}
        />
        <label>Construction Time</label>
        <input
          type="text"
          name="constructionTime"
          value={data.constructionTime}
          onChange={handleInputChange}
        />
        <div className="modal-buttons">
          <button onClick={onClose}>Cancel</button>
          <button onClick={handleSubmit}>Add</button>
        </div>
      </div>
    </div>
  );
}

export default AddDataModal;
